import React, {useEffect, useState} from 'react';
import axios from 'axios';
import './App.css';
import './nav.css';
import imagemain from './components/mainlogo.png';

function App() {
  const [hello, setHello] = useState('')

  useEffect(() => {
    axios.get('/api/hello') // get data from backend
        .then(response => setHello(response.data))
        .catch(error => console.log(error))
  }, []);

  return (
      <div>
        //백엔드에서 가져온 데이터입니다 : {hello}
        <div className="subtitle">LET'S GO HIGH-!</div>
        <nav id="menubar">
        <ul>
          <li><a href="#">HIKING FOOTPRINT</a></li>
          <li><a href="#">HIKING DIARY</a></li>
          <li><a href="#">LOGIN</a></li>
          <li><a href="#">SIGN UP</a></li>
          </ul>
        </nav>
        <div className="title">HIGH-GO</div> 
        <span>
          <img className="mainlogo" src={imagemain} alt="mainlogo"/>
        </span>
        <span>안녕하세요 HIGH-GO이용자 여러분<br/>
        저희 HIGH-GO는 등린이를 위한 취미 개발 웹서비스 입니다.<br/>
        등산을 하려고 마음은 먹었지만 어느 산을 가야하는지 고민이 많으셨죠?<br/>
        저희 HIGH-GO에서 제공되는 추천 알고리즘을 통해 나에게 딱! 알맞는 등산 코스를 정해봐요<br/>
        LET's GO HIGH-!
        </span>
    </div>
  );
}

export default App;
